INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 1, "あたしだって\nやるときはやるよ！", 1, 24, 0.0, 24001, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 0, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 1, 24, 0.0, 24002, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 1, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 1, "終わった終わった\n一人でもなんとか\nなるもんだね", 1, 24, 0.0, 24003, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 2, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 2, "やったね！\nこれでようやく\nサボれるよ…", 2, 24, 0.0, 24004, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 3, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 1, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 1, 24, 0.0, 24005, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 4, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 2, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 2, 24, 0.0, 24006, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 5, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 2, "あたしも意外と\nやるもんでしょ？", 2, 24, 0.0, 24007, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 6, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 4, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 4, 24, 0.0, 24008, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 7, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 4, "このままじゃ\nまっひ～に\n叱られちゃうよ", 4, 24, 0.0, 24009, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 8, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 4, "まじめに\nやったんだけどな…\n悔しいな～", 4, 24, 0.0, 24010, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 9, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 4, "やられた…\nねずみって意外と\nてごわいね", 4, 24, 0.0, 24011, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 10, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 4, "おのれ～\nあたしのチーズを\n盗みやがって～！", 4, 24, 0.0, 24012, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 11, 102601);
INSERT INTO `v1_647217c81b416ec2c02a55a8bc976e34c2258a2af4b44f0ccc6c8021d79f6a3a` VALUES (0.0, 10040, 0.0, 1, "疲れた…\nけど、次こそは\n守り抜くよ…", 4, 24, 1.81, 24013, "リン", "2030/12/17 14:59:59", "2020/04/30 12:00:00", 12, 102601);
